#include <tcframe/spec.hpp>
#include <bits/stdc++.h>
using namespace tcframe;
using namespace std;

typedef pair<int,int> PII;

class ProblemSpec : public BaseProblemSpec {
protected:
    int N, P;
    vector<string> UP, DOWN, LEFT, RIGHT;

    void InputFormat() {
        LINE(N, P);
        LINE(UP % SIZE(N));
        LINES(LEFT, RIGHT) % SIZE(N);
        LINE(DOWN % SIZE(N));
    }

    void StyleConfig() {
        CustomScorer();
        NoOutput();
    }

    void Constraints() {
        CONS(5 <= N && N <= 500);
        CONS(1 <= P && P <= N*N);
        CONS(validClue(UP));
        CONS(validClue(DOWN));
        CONS(validClue(LEFT));
        CONS(validClue(RIGHT));
        CONS(guaranteedSolution());
    }

    void Subtask1() {
        CONS(N == 10);
        CONS(P == 4);
    }

    void Subtask2() {
        CONS(N == 10);
        CONS(P == 9);
    }

    void Subtask3() {
        CONS(N == 30);
        CONS(P == 9);
        CONS(gapBetweenClue(4));
    }

    void Subtask4() {
        CONS(N == 60);
        CONS(P == 139);
        CONS(allClue());
    }

    void Subtask5() {
        CONS(N == 100);
        CONS(P == 137);
        CONS(noB());
    }

    void Subtask6() {
        CONS(N == 150);
        CONS(P == 152);
        CONS(valNotMoreThan(9));
    }

    void Subtask7() {
        CONS(N == 250);
        CONS(P == 181);
        CONS(noRowClue());
    }

    void Subtask8() {
        CONS(N == 357);
        CONS(P == 156);
        CONS(threeModFour());
    }

    void Subtask9() {
        CONS(N == 499);
        CONS(P == 427);
        CONS(gapBetweenClue(2));
    }

    void Subtask10() {
        CONS(N == 500);
        CONS(P == 978);
    }

private:
    bool validClue(const vector<string> &A) {
        if (A.size() != N) return false;

        for (int i = 0; i < N; i++) {
            if (A[i] == "-") continue;
            if (A[i] == "0") continue;

            int len = A[i].length();
            if (A[i][len-1] != 'M' && A[i][len-1] != 'B') return false;

            if (A[i][0] < '1' || A[i][0] > '9') return false;
            int val = A[i][0] - '0';

            for (int j = 1; j < len-1; j++) {
                if (A[i][j] < '0' || A[i][j] > '9') return false;    
                val = 10 * val + A[i][j] - '0';
            }
            if (val < 1 || val > N) return false;
        }

        return true;
    }

    bool guaranteedSolution() {
        char ans[507][507];
        for (int i = 0; i < N; i++) {
            for (int j = 0; j < N; j++) {
                ans[i][j] = ' ';
            }
        }

        // Check LEFT
        for (int i = 0; i < N; i++) {
            if (LEFT[i][0] == '-') continue;
            if (LEFT[i][0] == '0') {
                for (int j = 0; j < N; j++) {
                    if (ans[i][j] == ' ' || ans[i][j] == '#') ans[i][j] = '#';
                        else return false;
                }
            } else {
                int len = LEFT[i].length();
                int val = 0;
                for (int j = 0; j < len-1; j++) val = 10 * val + LEFT[i][j] - '0';
                for (int j = 0; j < val-1; j++) {
                    if (ans[i][j] == ' ' || ans[i][j] == '#') ans[i][j] = '#';
                        else return false;
                }
                int j = val-1;
                if (ans[i][j] == ' ' || ans[i][j] == LEFT[i][len-1]) ans[i][j] = LEFT[i][len-1];
                    else return false;
            }
        }

        // Check RIGHT
        for (int i = 0; i < N; i++) {
            if (RIGHT[i][0] == '-') continue;
            if (RIGHT[i][0] == '0') {
                for (int j = 0; j < N; j++) {
                    if (ans[i][N-1-j] == ' ' || ans[i][N-1-j] == '#') ans[i][N-1-j] = '#';
                        else return false;
                }
            } else {
                int len = RIGHT[i].length();
                int val = 0;
                for (int j = 0; j < len-1; j++) val = 10 * val + RIGHT[i][j] - '0';
                for (int j = 0; j < val-1; j++) {
                    if (ans[i][N-1-j] == ' ' || ans[i][N-1-j] == '#') ans[i][N-1-j] = '#';
                        else return false;
                }
                int j = val-1;
                if (ans[i][N-1-j] == ' ' || ans[i][N-1-j] == RIGHT[i][len-1]) ans[i][N-1-j] = RIGHT[i][len-1];
                    else return false;
            }
        }

        // Check UP
        for (int i = 0; i < N; i++) {
            if (UP[i][0] == '-') continue;
            if (UP[i][0] == '0') {
                for (int j = 0; j < N; j++) {
                    if (ans[j][i] == ' ' || ans[j][i] == '#') ans[j][i] = '#';
                        else return false;
                }
            } else {
                int len = UP[i].length();
                int val = 0;
                for (int j = 0; j < len-1; j++) val = 10 * val + UP[i][j] - '0';
                for (int j = 0; j < val-1; j++) {
                    if (ans[j][i] == ' ' || ans[j][i] == '#') ans[j][i] = '#';
                        else return false;
                }
                int j = val-1;
                if (ans[j][i] == ' ' || ans[j][i] == UP[i][len-1]) ans[j][i] = UP[i][len-1];
                    else return false;
            }
        }

        // Check DOWN
        for (int i = 0; i < N; i++) {
            if (DOWN[i][0] == '-') continue;
            if (DOWN[i][0] == '0') {
                for (int j = 0; j < N; j++) {
                    if (ans[N-1-j][i] == ' ' || ans[N-1-j][i] == '#') ans[N-1-j][i] = '#';
                        else return false;
                }
            } else {
                int len = DOWN[i].length();
                int val = 0;
                for (int j = 0; j < len-1; j++) val = 10 * val + DOWN[i][j] - '0';
                for (int j = 0; j < val-1; j++) {
                    if (ans[N-1-j][i] == ' ' || ans[N-1-j][i] == '#') ans[N-1-j][i] = '#';
                        else return false;
                }
                int j = val-1;
                if (ans[N-1-j][i] == ' ' || ans[N-1-j][i] == DOWN[i][len-1]) ans[N-1-j][i] = DOWN[i][len-1];
                    else return false;
            }
        }

        // Print board
        // printf("\n\n");
        // for (int i = 0; i < N; i++) {
        //     for (int j = 0; j < N; j++) {
        //         printf("%c", ans[i][j]);
        //     }
        //     printf("\n");
        // }
        // printf("\n\n");

        return true;
    }

    bool gapBetweenClue(int gaps) {
        vector<string> tmp;
        for (int i = 0; i < N; i++) tmp.push_back(UP[i]);
        for (int i = 0; i < N; i++) tmp.push_back(RIGHT[i]);
        for (int i = 0; i < N; i++) tmp.push_back(DOWN[N-1-i]);
        for (int i = 0; i < N; i++) tmp.push_back(LEFT[N-1-i]);
        for (int i = 0; i < gaps; i++) tmp.push_back(UP[i]);

        for (int i = 0; i < 4*N; i++) {
            if (tmp[i] != "-") {
                for (int j = 1; j <= gaps; j++) {
                    if (tmp[i+j] != "-") return false;
                }
            }
        }

        return true;
    }

    bool allClue() {
        for (int i = 0; i < N; i++) {
            if (LEFT[i] == "-" || RIGHT[i] == "-" || UP[i] == "-" || DOWN[i] == "-") return false;
        }
        return true;
    }

    bool noB() {
        for (int i = 0; i < N; i++) {
            int len = LEFT[i].length();
            if (LEFT[i][len-1] == 'B') return false;

            len = RIGHT[i].length();
            if (RIGHT[i][len-1] == 'B') return false;
            
            len = UP[i].length();
            if (UP[i][len-1] == 'B') return false;
            
            len = DOWN[i].length();
            if (DOWN[i][len-1] == 'B') return false;
        }
        return true;
    }

    bool valNotMoreThan(int maxVal) {
        for (int i = 0; i < N; i++) {
            int len = LEFT[i].length();
            if (LEFT[i][len-1] == 'M' || LEFT[i][len-1] == 'B') {
                int val = 0;
                for (int j = 0; j < len-1; j++) val = 10 * val + LEFT[i][j] - '0';
                if (val > maxVal) return false;
            }

            len = RIGHT[i].length();
            if (RIGHT[i][len-1] == 'M' || RIGHT[i][len-1] == 'B') {
                int val = 0;
                for (int j = 0; j < len-1; j++) val = 10 * val + RIGHT[i][j] - '0';
                if (val > maxVal) return false;
            }

            len = UP[i].length();
            if (UP[i][len-1] == 'M' || UP[i][len-1] == 'B') {
                int val = 0;
                for (int j = 0; j < len-1; j++) val = 10 * val + UP[i][j] - '0';
                if (val > maxVal) return false;
            }

            len = DOWN[i].length();
            if (DOWN[i][len-1] == 'M' || DOWN[i][len-1] == 'B') {
                int val = 0;
                for (int j = 0; j < len-1; j++) val = 10 * val + DOWN[i][j] - '0';
                if (val > maxVal) return false;
            }
        }
        return true;
    }

    bool noRowClue() {
        for (int i = 0; i < N; i++) {
            if (LEFT[i] != "-" || RIGHT[i] != "-") return false;
        }
        return true;
    }

    bool threeModFour() {
        for (int i = 0; i < N; i++) {
            int len = LEFT[i].length();
            if (LEFT[i][len-1] == 'M' || LEFT[i][len-1] == 'B') {
                int val = 0;
                for (int j = 0; j < len-1; j++) val = 10 * val + LEFT[i][j] - '0';
                if (val % 4 != 3 || (i + 1) % 4 != 3) return false;
            }

            len = RIGHT[i].length();
            if (RIGHT[i][len-1] == 'M' || RIGHT[i][len-1] == 'B') {
                int val = 0;
                for (int j = 0; j < len-1; j++) val = 10 * val + RIGHT[i][j] - '0';
                if (val % 4 != 3 || (i + 1) % 4 != 3) return false;
            }

            len = UP[i].length();
            if (UP[i][len-1] == 'M' || UP[i][len-1] == 'B') {
                int val = 0;
                for (int j = 0; j < len-1; j++) val = 10 * val + UP[i][j] - '0';
                if (val % 4 != 3 || (i + 1) % 4 != 3) return false;
            }

            len = DOWN[i].length();
            if (DOWN[i][len-1] == 'M' || DOWN[i][len-1] == 'B') {
                int val = 0;
                for (int j = 0; j < len-1; j++) val = 10 * val + DOWN[i][j] - '0';
                if (val % 4 != 3 || (i + 1) % 4 != 3) return false;
            }
        }
        return true;
    }
};

